import React from 'react'

export default class ProfileContainer extends React.Component {
  render() {
    let summoner = this.props.summoner
    return(
      <div className="profile_container summoner_info_item">
        {summoner.name 
          ? 
            <div>
              <h1>{summoner.name}</h1>
              <img src={summoner.profileImage} alt={`${summoner.name} profile`}/>
              <label>{summoner.summonerLevel}</label><br/>
              <h4>{summoner.ranks[0].rankType}</h4>
              <img src={`./images/ranked-emblems/Emblem_${summoner.ranks[0].tier}.png`} alt="rank_image"/>
            </div>
          : null
        }
      </div>
    )
  }
}
